wer'=>'Hình ảnh một bông hoa','Pattern descriptionA hero with a full width image, heading, short paragraph and button.'=>'Hero với hình ảnh toàn chiều rộng, tiêu đề, đoạn văn ngắn và nút.','Pattern titleHero, full width image'=>'Hero, hình ảnh toàn chiều rộng','CTA text of the hero section.Available for pre-order now.'=>'Hiện có sẵn để đặt hàng trước.','Content of the hero section.A fine collection of moments in time featuring photographs from Louis Fleckenstein, Paul Strand and Asahachi Kōno.'=>'Một bộ sưu tập tuyệt vời về những khoảnh khắc thời gian với các bức ảnh của Louis Fleckenstein, Paul Strand và Asahachi Kōno.','Heading of the hero section.The Stories Book'=>'Sách những câu chuyện','Image of the book'=>'Hình ảnh cuốn sách','Pattern descriptionA hero section for the book with a description and pre-order link.'=>'Phần anh hùng cho cuốn sách với mô tả và liên kết đặt hàng trước.','Pattern titleHero book'=>'Hero book','Alt text for Overview picture.Cliff Palace, Colorado'=>'Cliff Palace, Colorado','Event Overview Text.Held over a weekend, the event is structured around a series of exhibitions, workshops, and panel discussions. The exhibitions showcase a curated selection of photographs that tell compelling stories from various corners of the globe, each image accompanied by detailed narratives that provide context and deeper insight into the historical significance of the scenes depicted. These photographs are drawn from the archives of renowned photographers, as well as emerging talents, ensuring a blend of both classical and contemporary perspectives.'=>'Được tổ chức vào cuối tuần, sự kiện được 구성 xung quanh một loạt các triển lãm, hội thảo và thảo luận nhóm. Các triển lãm giới thiệu tuyển chọn các bức ảnh được tuyển chọn kỹ lưỡng, kể những câu chuyện hấp dẫn từ khắp nơi trên thế giới, mỗi bức ảnh kèm theo những câu chuyện chi tiết cung cấp bối cảnh và cái nhìn sâu sắc hơn về ý nghĩa lịch sử của những cảnh được mô tả. Những bức ảnh này được lấy từ kho lưu trữ của các nhiếp ảnh gia nổi tiếng, cũng như các tài năng mới nổi, đảm bảo sự pha trộn giữa cả quan điểm cổ điển và đương đại.','About the event'=>'Về sự kiện','Pattern descriptionA two-column section with a heading and paragraph on the left, and an image on the right.'=>'Phần hai cột với tiêu đề và đoạn văn bên trái và hình ảnh bên phải.','Pattern titleHeading and paragraph with image on the right'=>'Tiêu đề và đoạn văn với hình ảnh bên phải','Pattern descriptionHeader with site title and navigation.'=>'Đầu trang với tiêu đề trang web và điều hướng.','Pattern titleHeader'=>'Đầu trang','Pattern descriptionHeader with large site title and right-aligned navigation.'=>'Đầu trang với tiêu đề trang web lớn và điều hướng căn phải.','Pattern titleHeader with large title'=>'Đầu trang với tiêu đề lớn','Pattern descriptionHeader with site title and navigation in columns.'=>'Đầu trang với tiêu đề trang web và điều hướng theo cột.','Pattern titleHeader with columns'=>'Đầu trang với cột','Pattern descriptionHeader with centered site title and navigation.'=>'Đầu trang với tiêu đề trang web và điều hướng ở giữa.','Pattern titleCentered header'=>'Đầu trang ở giữa','Sunflowers'=>'Hoa hướng dương','Cactus'=>'Xương rồng','Anthuriums'=>'Hoa hồng môn','Close up of a red anthurium.'=>'Cận cảnh một bông hồng môn đỏ.','Top Categories'=>'Danh mục hàng đầu','Pattern descriptionA grid section with different categories.'=>'Phần lưới với các danh mục khác nhau.','Pattern titleGrid with categories'=>'Lưới với danh mục','Podcast'=>'Podcast','Explore the episodes'=>'Khám phá các tập','Pattern descriptionA grid with videos.'=>'Lưới với video.','Pattern titleGrid with videos'=>'Lưới với video','https://example.com'=>'https://example.com','The Stories Book, a fine collection of moments in time featuring photographs from Louis Fleckenstein, Paul Strand and Asahachi Kōno, is available for pre-order'=>'Sách những câu chuyện, một bộ sưu tập tinh tế về những khoảnh khắc thời gian với