an lang="es">historias</span>, <span lang="uk">iсторії</span>, <span lang="el">iστορίες</span>”'=>'“Câu chuyện, <span lang="es">historias</span>, <span lang="uk">історії</span>, <span lang="el">ιστορίες</span>”','Picture of a historical building in ruins.'=>'Hình ảnh một tòa nhà lịch sử đổ nát.','Pattern descriptionA section that can be used as a banner or a landing page to announce an event.'=>'Một phần có thể được sử dụng làm biểu ngữ hoặc trang đích để thông báo sự kiện.','Pattern titlePoster-like section'=>'Phần giống như áp phích','Example brand name.Fleurs'=>'Fleurs','Pattern placeholder text.We\'re %s, our mission is to deliver exquisite flower arrangements that not only adorn living spaces but also inspire a deeper appreciation for natural beauty.'=>'Chúng tôi là %s, sứ mệnh của chúng tôi là cung cấp các loại hoa tuyệt đẹp không chỉ tô điểm cho không gian sống mà còn truyền cảm hứng cho sự đánh giá sâu sắc hơn về vẻ đẹp tự nhiên.','Pattern descriptionA large left-aligned heading with a brand name emphasized in bold.'=>'Tiêu đề căn trái lớn với tên thương hiệu được in đậm.','Pattern titleIntro with left-aligned description'=>'Giới thiệu với mô tả căn trái','Button text of intro section.Learn More'=>'Tìm hiểu thêm','Sample description for banner with flower.Like flowers that bloom in unexpected places, every story unfolds with beauty and resilience, revealing hidden wonders.'=>'Giống như những bông hoa nở rộ ở những nơi không ngờ tới, mỗi câu chuyện đều mở ra với vẻ đẹp và sức sống mãnh liệt, hé lộ những điều kỳ diệu tiềm ẩn.','Heading for banner pattern.New arrivals'=>'Hàng mới về','Alt text for intro picture.Picture of a flower'=>'Hình ảnh một bông hoa','Pattern descriptionA Intro pattern with Short heading, paragraph and image on the left.'=>'Mẫu giới thiệu với tiêu đề ngắn, đoạn văn và hình ảnh bên trái.','Pattern titleShort heading and paragraph and image on the left'=>'Tiêu đề ngắn và đoạn văn và hình ảnh bên trái','Stories'=>'Câu chuyện','Photo of a field full of flowers, a blue sky and a tree.'=>'Ảnh chụp một cánh đồng đầy hoa, bầu trời xanh và một cái cây.','Pattern descriptionA full-width cover section with a large background image and an oversized heading.'=>'Phần bìa toàn chiều rộng với hình nền lớn và tiêu đề quá khổ.','Pattern titleCover with big heading'=>'Bìa với tiêu đề lớn','Image of a book'=>'Hình ảnh một cuốn sách','Pattern placeholder text.This exquisite compilation showcases a diverse array of photographs that capture the essence of different eras and cultures, reflecting the unique styles and perspectives of each artist. Fleckenstein’s evocative imagery, Strand’s groundbreaking modernist approach, and Kōno’s meticulous documentation of Japanese life come together in a harmonious blend that celebrates the art of photography. Each image in “The Stories Book” is accompanied by insightful commentary, providing historical context and revealing the stories behind the photographs. This collection is not only a visual feast but also a tribute to the power of photography to preserve and narrate the multifaceted experiences of humanity.'=>'Tuyển tập tinh tế này trưng bày một loạt ảnh đa dạng, nắm bắt được bản chất của các thời đại và nền văn hóa khác nhau, phản ánh phong cách và quan điểm độc đáo của mỗi nghệ sĩ. Hình ảnh gợi cảm của Fleckenstein, cách tiếp cận hiện đại đột phá của Strand và tài liệu tỉ mỉ về cuộc sống Nhật Bản của Kōno kết hợp với nhau trong một sự pha trộn hài hòa, tôn vinh nghệ thuật nhiếp ảnh. Mỗi hình ảnh trong “Sách những câu chuyện” đều kèm theo lời bình luận sâu sắc, cung cấp bối cảnh lịch sử và tiết lộ những câu chuyện đằng sau các bức ảnh. Bộ sưu tập này không chỉ là một bữa tiệc thị giác mà còn là sự tôn vinh sức mạnh của nhiếp ảnh trong việc lưu giữ và kể lại những trải nghiệm đa diện của nhân loại.','About the book'=>'Về cuốn sách','Pattern descriptionBanner with book description and accompanying image for promotion.'=>'Biểu ngữ với mô tả sách và hình ảnh kèm theo để quảng cáo.','Pattern titleBanner with book description'=>'Biểu ngữ với mô tả sách','Label for the block binding placeholder in the editorPost format name'=>'Tên định dạng bài đăng','A collection of post format patterns.'=>'Bộ sưu tập các mẫu định dạng bài đăng.','Post formats'=>'Định dạng bài đăng','A collection of full page layouts.'=>'Bộ sưu tập bố cục trang đầy đủ.','Pages'=>'Trang','Checkmark'=>'Dấu tích','https://wordpress.org'=>'https://wordpress.org','the WordPress team'=>'nhóm WordPress','https://wordpress.org/themes/twentytwentyfive/'=>'https://wordpress.org/themes/twentytwentyfive/']];